  summary: Provides a thread-safe collection that contains channel dispatchers.
  remarks: "This collection is used by &lt;xref:CoreWCF.ServiceHostBase> to manage the channel dispatchers associated with the host. A &lt;xref:CoreWCF.Dispatcher.ChannelDispatcherCollection> is created when &lt;xref:CoreWCF.ServiceHostBase.%23ctor%2A> is called and the collection can be accessed using the &lt;xref:CoreWCF.ServiceHostBase.ChannelDispatchers%2A> property.  \n\nThe collection contains &lt;xref:CoreWCF.Dispatcher.ChannelDispatcherBase> objects (and not just instances of &lt;xref:CoreWCF.Dispatcher.ChannelDispatcher>) because it is also used by developers who want to keep the Windows Communication Foundation (WCF)programming model but replace the system-provided runtime. They derive a class from &lt;xref:CoreWCF.Dispatcher.ChannelDispatcherBase> and extend &lt;xref:CoreWCF.ServiceHost> (which inherits from &lt;xref:CoreWCF.ServiceHostBase>) by overriding &lt;xref:CoreWCF.ServiceHostBase.InitializeRuntime%2A>, adding instances of the class derived from &lt;xref:CoreWCF.Dispatcher.ChannelDispatcherBase> to &lt;xref:CoreWCF.ServiceHostBase.ChannelDispatchers%2A>.  \n\nThis class has no public constructors and is not intended to be used outside of the &lt;xref:CoreWCF.ServiceHost>.  \n\n"
  syntax:
    content: 'public class ChannelDispatcherCollection : SynchronizedCollection<ChannelDispatcherBase>'
    content.vb: >-
      Public Class ChannelDispatcherCollection
          Inherits SynchronizedCollection(Of ChannelDispatcherBase)
